import React from 'react';
import { View, StyleSheet } from 'react-native';
import Banner from './Banner';

const Home = () => {
    return (
        <View style={styles.homeContainer}>
            {/* <Banner /> */}
        </View>
    );
}

const styles = StyleSheet.create({
    homeContainer: {
        width: '100vw',
        minHeight: '40vh',
        backgroundColor: "white",
    }
})

export default Home;
